import React, { Component } from "react"
import Grid from 'styled-components-grid'
import styled from 'styled-components'
import {Section} from './GridBlocks'
import {H3heading, Ptext} from './Typography.js'

const Heading = styled(H3heading)`
	color:#82C600;
	text-align:center;

`
const Text = styled(Ptext)`
	color:#999999;
	text-align:center;

`


export default class FooterBlock extends Component{
	render(){
		return (
			<Section>
			<Grid.Unit size={4 / 6}>
				</Grid.Unit>
			</Section>
		)
	}
}
